import React from "react";
import { Shaders, Node, GLSL } from "gl-react";

class Slide extends React.Component {
  render() {
    const { blue } = this.props;
    return <Node shader={shaders.helloBlue} uniforms={{ blue }} />;
  }
}

export default Slide;
